import { Route, Switch } from 'react-router-dom';
import './App.css';
import Bar from './components/Bar';
import Forum from './components/Forum';
import Home from './components/Home';
function App() {
  return (
    <div className="App">
      <Switch>
      <Bar/>
      <Route path='/' component={Home}/>
      <Route path='/blog' component={Forum}/>
      </Switch>
    </div>
  );
}

export default App;
